import './App.css';
import Employee from './components/Employee';

function App() {
  console.log("we are about to list the employee");
  const showEmployees = true;
  return (
    <div className="App">
      {showEmployees ?
        <>
          <Employee />
          <Employee />
          <Employee />
          <Employee />
          <Employee />
        </>
        :
        <p>You cannot see the employees.</p>
      }
    </div>
  );
}

export default App;
